import { useState } from 'react';

export function UserName() {
    const [firstName, setFirstName] = useState('');
    return (
        <div>
            <form>
                <label>
                    Name:
                    <input value={firstName} type="text" name="name" onSubmit={e => setFirstName(e.target.value)} />
                </label>
                <button onSubmit={() => setFirstName(firstName)} type="submit">Submit</button>
            </form>
            <div>
                Hello {firstName}! Let's get started.
            </div>
        </div>
    );
  };
